def twoSum(numbers, target):
    """
    :type numbers: List[int]
    :type target: int
    :rtype: List[int]
    """
    numbers_set = set(numbers)
    numbers_dict = dict()
    for n in numbers_set:
        numbers_dict[n] = [pos for pos, v in enumerate(numbers) if v == n][0]

    for n in numbers_set:
        if n * 2 == target:
            ind1 = numbers_dict[n] + 1
            ind2 = numbers_dict[n] + 2
            res = [ind1, ind2]
            res.sort()
            return res
        else:
            diff = target - n
            if diff in numbers_dict.keys():
                ind1 = numbers_dict[n] + 1
                ind2 = numbers_dict[diff] + 1
                res = [ind1, ind2]
                res.sort()
                return res

